def getLevelBackground( level=0 ):
    BG = 0
    if level == 33: BG = 5
    elif level in range( 1, 33, 4 ): BG = 1
    elif level in range( 2, 33, 4 ): BG = 2
    elif level in range( 3, 33, 4 ): BG = 3
    elif level in range( 4, 33, 4 ): BG = 4
    return BG


def getHitsToDestroy( level=0 ):
    # for silver wall only ( 1-8=2, 9-16=3, 17-24=4, 25-32=5 )
    hits = 2
    if 9 <= level <= 16: hits += 1
    elif 17 <= level <= 24: hits += 2
    elif 25 <= level <= 32: hits += 3
    return hits



